class Solution:
    def numSub(self, s: str) -> int:
        ans=0
        tmp=s.split('0')
        for a in tmp:
            t=len(a)
            ans+=int((t+1)*t/2)
            ans=ans%(1e9 + 7)
        return int(ans)

s=Solution()
null=None
test=[
    {"input":     "","output":62},

    {"input":     "1111111111011010011","output":62},


]
for t in test:
    r=s.numSub(t['input'])
    if r!=t['output']:
        print("error:"+str(t)+" out:"+str(r))
